import React from "react";

export const Article = ({data}) => {
  return (
    <>
      <div class="jumbotron">
        <h1 class="display-4">{data.title}</h1>
        <p class="lead">
         {data.summary}
        </p>

        <p class="lead">
          <a class="btn btn-primary btn-lg" href="{data.url}" role="button">
            Learn more
          </a>
        </p>
      </div>
    </>
  );
};
